import React from "react";

const Home = () => {
    return (
        <>
            <h1>
                Hello world!
            </h1>
            <div className="grid lg:grid-cols-5 md:grid-cols-4 sm:grid-cols-4 gap-2">
                <div className="py-10 sm:bg-blue-400 bg-red-600 text-center">now 640px</div>
                <div className="py-10 md:bg-blue-400 bg-red-600 text-center">now 768px</div>
                <div className="py-10 lg:bg-blue-400 bg-red-600 text-center">now 1024px</div>
                <div className="py-10 xl:bg-blue-400 bg-red-600 text-center">now 1280px</div>
                <div className="py-10 2xl:bg-blue-400 bg-red-600 text-center">now 1536px</div>
            </div>
        </>
    );
};

export default Home;
